import React, { Component } from 'react';
import Todos from './components/Todos';
import './App.css';

class App extends Component {

  state = {

  todos:[
       {id:1,
        title:'meeting clients',
        completed:false
      },
        {id:2,
        title:'repairing Acer computer',
        completed:true
      },
        {id:3,
        title:'chairing a meeting',
        completed:false
      }
  ]
}
  render() {
    return (
      <div className="App">
        <Todos />
      </div>
    )
  }
}

export default App;
